function Report() {
  return (
    <div className="Report">
      <h2>Co-op Work Term Report</h2>
      <section>
        <h3>Experiences</h3>
        <p>Detail your experiences during the co-op work term here.</p>
      </section>
      <section>
        <h3>Learnings</h3>
        <p>Discuss what you learned during the co-op work term here.</p>
      </section>
      <section>
        <h3>Conclusions</h3>
        <p>Summarize your conclusions and reflections on the co-op work term here.</p>
      </section>
    </div>
  );
}

export default Report;
